import React from 'react'
import MenuIcon from '@mui/icons-material/Menu';

function Header() {
  return (
    <div>
    <MenuIcon/>
    <img src="https://www.google.com.pk/imgres?imgurl=https%3A%2F%2Fwww.gstatic.com%2Fyoutube%2Fimg%2Fbranding%2Fyoutubelogo%2Fsvg%2Fyoutubelogo.svg&tbnid=mJe9Z8aqJSzHdM&vet=12ahUKEwj81rLtxdSBAxVHcmwGHclQDG0QMygKegUIARCEAQ..i&imgrefurl=https%3A%2F%2Fwww.youtube.com%2Fhowyoutubeworks%2Fresources%2Fbrand-resources%2F&docid=gKYjnt0h_SiCMM&w=800&h=179&itg=1&q=youtube%20logo&ved=2ahUKEwj81rLtxdSBAxVHcmwGHclQDG0QMygKegUIARCEAQ" alt="" />
   
    </div>
  )
}

export default Header
